window.bookSummaryJSON = "<p><b>The second captivating installment of Aleron Kong's Chaos Seeds series.</b></p> <p>\"We are life takers and heartbreakers,\" Richter shouted. \"Let's go!\"</p> <p>Richter and Sion are at it again! Even more of what you loved in the first book. Leveling, world building, awesome items, and what's that you say? Sure! Why not? What's a little necrophilia between friends?</p> <p>Join your favorite Chaos Seed as he answers the call of adventure and deals with the invaders, greedy dwarves, and a wood elf that keeps telling him he has a pretty mouth. Welcome back, my friends!</p> <p>Welcome back...to The Land.</p>"; 
